/*Table structure for table `hr_position_job` */

DROP TABLE IF EXISTS `hr_position_job`;

CREATE TABLE `hr_position_job` (
  `POSITION_JOB_ID` bigint(20) NOT NULL,
  `POSITION_ID` bigint(20) DEFAULT NULL,
  `JOB_TITLE` varchar(64) DEFAULT NULL,
  `JOB_CATEGORY_ID` bigint(20) NOT NULL,
  `JOB_DESC` varchar(512) DEFAULT NULL,
  `JOB_INPUT` varchar(512) DEFAULT NULL COMMENT 'input of the job, e.g. : target revenue, budget ',
  `JOB_OUTPUT` varchar(512) DEFAULT NULL COMMENT 'output of the job : real revenue, profit, new customers',
  `SCHEDULE_TYPE` int(2) DEFAULT NULL COMMENT '0= according to work schedule\n1= specific time\n2=allday job',
  `REPEAT_TYPE` int(8) DEFAULT NULL COMMENT '0= regular job time\n1=repeat daily\n2=repeat weekly\n3=repeat monthly\n4=repeat yearly\n5=one time job ( only once during works )',
  `START_DATETIME` datetime DEFAULT NULL,
  `END_DATETIME` datetime DEFAULT NULL,
  `REPEAT_EVERY` int(8) DEFAULT NULL COMMENT 'depending on REPEAT_TYPE',
  `REPEAT_UNTIL_DATE` datetime DEFAULT NULL COMMENT 'null= forever\n',
  `REPEAT_UNTIL_QTY` int(8) DEFAULT NULL COMMENT '0=forever',
  `REPEAT_WEEK_DAYS` int(8) DEFAULT NULL COMMENT ' last significant byte ( 8 bit terakhir)\n\nbit 0 = Sunday / minggu\nbit 1 = Monday/senin\nbit 2 = Tuesday / selasa\nbit 3 = Wednesday / rabu\nbit 4 = Thurday /kamis\nbit 5 = Friday / jumat\nbit 6 = Saturday\n',
  `REPEAT_MONTH_DATE` int(8) DEFAULT NULL,
  `REPEAT_MONTH_DAY` int(8) DEFAULT NULL,
  `REMINDER_MINUTES_BEFORE` int(8) DEFAULT NULL,
  `NOTIFICATION` int(4) DEFAULT NULL COMMENT '0=none\n1=notification system message\n2=email\n3=sys message & email',
  `CHECKER_POSITION_ID` bigint(20) DEFAULT NULL COMMENT '0  means according to upper link position\n!= 0  means use tthis value ',
  `APPROVER_POSITION_ID` bigint(20) DEFAULT NULL COMMENT '0  means according to upper link position\n!= 0  means use tthis value ',
  PRIMARY KEY (`POSITION_JOB_ID`,`JOB_CATEGORY_ID`),
  KEY `fk_hr_position_job_hr_position1_idx` (`POSITION_ID`),
  KEY `fk_hr_position_job_hr_job_category1_idx` (`JOB_CATEGORY_ID`),
  KEY `fk_hr_position_job_hr_position2_idx` (`CHECKER_POSITION_ID`),
  KEY `fk_hr_position_job_hr_position3_idx` (`APPROVER_POSITION_ID`),
  CONSTRAINT `fk_hr_position_job_hr_job_category1` FOREIGN KEY (`JOB_CATEGORY_ID`) REFERENCES `hr_job_category` (`JOB_CATEGORY_ID`) ON UPDATE CASCADE,
  CONSTRAINT `fk_hr_position_job_hr_position1` FOREIGN KEY (`POSITION_ID`) REFERENCES `hr_position` (`POSITION_ID`) ON UPDATE CASCADE,
  CONSTRAINT `fk_hr_position_job_hr_position2` FOREIGN KEY (`CHECKER_POSITION_ID`) REFERENCES `hr_position` (`POSITION_ID`) ON UPDATE CASCADE,
  CONSTRAINT `fk_hr_position_job_hr_position3` FOREIGN KEY (`APPROVER_POSITION_ID`) REFERENCES `hr_position` (`POSITION_ID`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

